import './users.css'
import Sidebar from '../Sidebar/sidebar';

const Users = ({ user }) => {
    return (
        <>
            <Sidebar user={user} />
            <div className="users">
                <h1>Users</h1>
            </div>
        </>
    )
    }

export default Users;
